    const {id} = useParams();
    const [doggie, setDoggie] = useState({});



    useEffect(() => {
        axios(`https://api.thedogapi.com/v1/breeds/${id}`)
        .then(response => response.data)
        .then(( data ) => {
           if (data.name) {
              setDoggie(data);
